description:
20 juin 1980, entre Paris et Marseille, une violente secousse surprend le vol 173. L&amp;#039;avion disparait.

20 ans plus tard, dans la maison familiale qu&amp;#039;elle desire vendre, Laure de Lestrade retrouve, dans ses vieux cahiers, une succession de dessins geometriques accompagnes de cette phrase : &quot;Nous devons nous retrouver !&quot;.

Non loin de la, la jeune femme decouvre un immense Crop Circle dont le graphisme lui rappelle curieusement celui de ses dessins d&amp;#039;enfant. Sur les lieux, un inconnu l&amp;#039;agresse et la met en garde contre un danger imminent en lui assenant cette meme phrase : &quot; Nous devons nous retrouver&quot;.

Son pere la rassure mais reste evasif quant a la disparition de sa mere. Xavier, son fiance, est persuade qu&amp;#039;il lui cache quelque chose. Intriguee, Laure decide de mener une enquete et fait des decouvertes importantes sur ses proches... Elle comprend pourquoi son demi-frere Francois lui voue une animosite affichee et sa belle-mere, une haine courtoise. 

Cependant, Laure est confrontee a des phenomenes inexplicables, des signes etranges. Elle a parfois le sentiment de cotoyer un monde parallele. Avec Xavier, elle va devoir revenir sur un passe qu&amp;#039;ils croyaient revolu...
